import React from "react";
import { Carousel, CarouselItem } from "react-bootstrap";
import "../components/home.css"


function Home() {
  return (
    <div className="Home">
      <main>
        <Carousel>
          <CarouselItem>
            <img
            src = "/stateCapital.jpg" alt = "image"
            />
          </CarouselItem>

        </Carousel>
      </main>
    </div>
  );
}

export default Home;
